let initialState ={
    dialogsPage: {
        users: [
            {id: 1, name: "Dimych"},
            {id: 2, name: "Ivan"},
            {id: 3, name: "Sveta"},
            {id: 4, name: "Olga"},
            {id: 5, name: "Sasha"}],
        messages: [
            {id: 1, message: "hello"},
            {id: 2, message: "WHats up?"},
            {id: 3, message: "How is your name?"},
            {id: 4, message: "bla bla bla"},
            {id: 5, message: "Yo"},
            {id: 6, message: "Hello from Yata with love"}
        ],
        currentValue:""
    },
}
let  profileReducer =(state = initialState,action)=>{
    switch (action.type) {
        case "ADD-POST":
            state.posts.push({text: state.currentValue , id: 6, like: 2})
            state.currentValue = "";
            return state;
        case "POST-CHANGED":
            state.currentValue = action.value;
            return state;
        default:
            return state;
    }
}
export default profileReducer;
